import React, { Component } from "react";
import "./Contact.css";
import { } from 'react-bootstrap';

export default class Contact extends Component {  
  constructor(props) {
    super(props);
    this.state = {}    
  }

  render() {
   
    return (
      <div className="footer">
        <p id="title">CPR Registry Contact Info</p>
        <p id="email">CPR Registry Contact Info</p>
        <p id="address">CPR Registry Contact Info</p>
      </div>
    );
  }
}
